import React from 'react';
import ReactDOM from 'react-dom';

function myList() {
    return ['Ye', 'No', 'Maybe'];
}

function MyApp() {
    return (
    <ul>
        for (s : myList()) {}
        <li>{ myList()[0] }</li>
    </ul>
    )
}

ReactDOM.render(<MyApp />, document.getElementById("root"));
